import React from "react";
import Layout from "../../../Common/Component/Layout";
import mainImg from "../../../Image/ev5_result.png";
import "./index.scss";

export default function View(props) {
  const { users } = props;
  return (
    <Layout>
      <div className="eventEnd5">
        <img className="ev5ResultImg" src={mainImg} alt="result" />
        <div className="ev5Results">
          <div className="ev5Notice">위즈랩 신규 회원을 모두 환영합니다.</div>
          <div className="ev5Notice">당첨자 여러분 축하드립니다.</div>
          <div className="ev5Users">
            {users.map((u, index) => {
              return (
                <div key={index} className="ev5User">
                  {u}
                </div>
              );
            })}
          </div>
        </div>
      </div>
    </Layout>
  );
}
